import React, { useState } from "react";
import KeyWebsitePage from "../Tabs/KeyWebsite";
import EbookPage from "../Tabs/Ebook";
import BlogPage from "../Tabs/Blog";
import FaqPage from "../Tabs/Faq";
import SupportPage from "../Tabs/Support";

const TabContentPage = () => {
  const [activeTab, setActiveTab] = useState("KeyWebsite");

  return (
    <div>
      <div className="tab-buttons">
        <button onClick={() => setActiveTab("KeyWebsite")}>Key Website</button>
        <button onClick={() => setActiveTab("Ebook")}>E-Book/Guide</button>
        <button onClick={() => setActiveTab("Blog")}>Blog</button>
        <button onClick={() => setActiveTab("Faq")}>FAQ</button>
        <button onClick={() => setActiveTab("Support")}>Support</button>
      </div>
      <div className="tab-content" id="myTabContent">
        {activeTab === "KeyWebsite" && <KeyWebsitePage />}
        {activeTab === "Ebook" && <EbookPage />}
        {activeTab === "Blog" && <BlogPage />}
        {activeTab === "Faq" && <FaqPage />}
        {activeTab === "Support" && <SupportPage />}
      </div>
    </div>
  );
};

export default TabContentPage;
